import React from "react";
import { useNavigate } from "react-router-dom";

const HomeScreen = () => {
  const navigate = useNavigate();

  return (
    <div>
      <h2>DEPHIDES: Deep Learning Based Phishing Detection System</h2>
      <button onClick={() => {
        alert("Enter Input Clicked!");
        navigate("/input");
      }}>
        Press here to Enter Input
      </button>

      <button onClick={() => navigate("/output")}>
        Press here to display output on Screen
      </button>

      <button onClick={() => console.log("Store output logic here")}>
        Press here to store the output
      </button>
    </div>
  );
};

export default HomeScreen;
